import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './Components/header/header.component';
import { ListSkillsComponent } from './Components/list-skills/list-skills.component';
import { SkillsComponent } from './Components/skills/skills.component';
import { ExperienceComponent } from './Components/experience/experience.component';
import { ExperienceDetailsComponent } from './Components/experience-details/experience-details.component';
import { HomeComponent } from './Components/not-found/home/home.component';
import { NotFoundComponent } from './Components/not-found/not-found.component';
import { FooterComponent } from './Components/footer/footer.component';

@NgModule({
  // Ajout des composants
  declarations: [
    AppComponent,
    HeaderComponent,
    ListSkillsComponent,
    SkillsComponent,
    ExperienceComponent,
    ExperienceDetailsComponent,
    HomeComponent,
    NotFoundComponent,
    FooterComponent
  ],
  // Inserer toutes les bibliotheques installées
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  // Intégration des services qui vont faire appel à l'API
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
